iv>\r\n\r\n<ul>\r\n	<li>Chand Khanna, D.V.M., Ph.D.</li>\r\n	<li>Len Neckers, Ph.D.</li>\r\n	<li>Dimiter S. Dimitrov, Ph.D</li>\r\n	<li>Donald P. Bottaro, Ph.D.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<!-- 4th Flex Container -->\r\n\r\n<div class="flex-container">\r\n<div>\r\n<div>2008 Winners</div>\r\n\r\n<ul>\r\n	<li>Erik M. Augustson, Ph.D.</li>\r\n	<li>Wm. Douglas Figg, Sr., Pharm.D</li>\r\n	<li>Jackie Lavigne, Ph.D.</li>\r\n	<li>Glenn Merlino, Ph.D.</li>\r\n</ul>\r\n</div>\r\n\r\n<div>\r\n<div>2007 Winners</div>\r\n\r\n<ul>\r\n	<li>Demetrius Albanes, M.D.</li>\r\n	<li>Curtis C. Harris, M.D.</li>\r\n	<li>Sue H. Wickner, Ph.D</li>\r\n</ul>\r\n</div>\r\n\r\n<div>\r\n<div>2006 Winners</div>\r\n\r\n<ul>\r\n	<li>William L. Farrar, Ph.D.</li>\r\n	<li>Susan Gottesman, Ph.D.</li>\r\n	<li>Ira Pastan, M.D.</li>\r\n	<li>Alfred Singer, M.D.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<!-- 5th Flex Container -->\r\n\r\n<div class="flex-container">\r\n<div>\r\n<div>2005 Winners</div>\r\n\r\n<ul>\r\n	<li>Graça Dores, M.D., M.P.H.</li>\r\n	<li>Stephen Katz, M.D., Ph.D.</li>\r\n	<li>Patricia Steeg, Ph.D.</li>\r\n</ul>\r\n</div>\r\n\r\n<div>\r\n<div>2004 Winners</div>\r\n\r\n<ul>\r\n	<li>Daniel McVicar, Ph.D.</li>\r\n	<li>Joost Oppenheim, M.D.</li>\r\n	<li>Stuart Rudikoff, Ph.D.</li>\r\n</ul>\r\n</div>\r\n\r\n<div>\r\n<div>2003 Winners</div>\r\n\r\n<ul>\r\n	<li>Sonia Jakowlew, Ph.D.</li>\r\n	<li>Barbara Vonderhaar, Ph.D.</li>\r\n	<li>Jonathan Wiest, Ph.D.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<div style="margin-left:15px;font-weight:bold;font-size:12pt;">*Those who have received the award within the last five years are not eligible.</div>\r\n','','full_html');
INSERT INTO `field_data_body` VALUES ('node','page','0','5','5','und','0','<p>For questions related to Outstanding Mentor Award Application submission, please contact Angela Jones <a href="mailto:jonesangel@mail.nih.gov" title="jonesangel@mail.nih.gov">jonesangel@mail.nih.gov</a>.</p>\r\n\r\n<p>For technical issues related to this website, please contact NCI-CBIIT Application Support.</p>\r\n\r\n<p><strong>NCI-CBIIT Application Support Telephone: 240-276-5541 or toll free: 888-478-4423</strong><br />\r\n<strong>Email: <a href="mailto:ncicbiit@mail.nih.gov" title="ncicbiit@mail.nih.gov">ncicbiit@mail.nih.gov</a></strong><br />\r\nTelephone support is available Monday to Friday, 9:00 a.m. to 5:00 p.m. Eastern Time, excluding government holidays. Leave a message or send an email at any time. When submitting support requests via email, please include:</p>\r\n\r\n<ul>\r\n	<li>Contact information so Application Support can reply</li>\r\n	<li>The name of the application with the issue</li>\r\n	<li>The URL if it is a web-based application</li>\r\n	<li>A description of the problem and steps to re-create it</li>\r\n	<li>The text of any error messages</li>\r\n</ul>\r\n','','filtered_html'),('node','page','0','6','6','und','0','<h2 class="rtecenter">HISTONE MUTATED MIDLINE GLIOMA WORKSHOP</h2>\r\n\r\n<p>Date: September 27, 2018</p>\r\n\r\n<p>Location: National Institutes of Health (NIH), Building 60, Bethesda, MD</p>\r\n\r\n<p>The workshop for the NCI-CONNECT (Comprehensive Oncology Network Evaluating Rare CNS Tumors) will be held on September 27, 2018. As part of our Moonshot program where we are studying rare CNS cancers in adults, we are organizing a workshop on September 27, 2018 for colleague experts in histone biology, translational research in brain tumors, pathology, and clinical research to discuss histone mutated midline gliomas. The primary organizer of the workshop is NCI''s Center for Cancer Research, Neuro-Oncology Branch which serves as the lead institution and coordinating center for the NCI-CONNECT, a national and international investigator network developing for the purpose of studying select adult rare CNS cancer.</p>\r\n\r\n<p><strong>Important Deadlines:</strong></p>\r\n\r\n<ul>\r\n	<li>Register for the meeting by July 27. <a href="nciconnect/registration" title="REGISTER NOW">REGISTER NOW</a></li>\r\n	<li>Book your hotel room at the Bethesda Marriott by July 27. <a href="https://www.marriott.com/hotels/travel/wasbt-bethesda-marriott/" target="_blank" title="BOOK HOTEL">BOOK HOTEL</a></li>\r\n	<li>Researchers submit study proposals by July 30. <a href="/sites/default/files/Proposal.doc" title="SUBMIT PROPOSAL">SUBMIT PROPOSAL</a></li>\r\n</ul>\r\n\r\n<p>Agenda:</p>\r\n\r\n<ul>\r\n	<li>September 27, 2018\r\n	<ul>\r\n		<li>\r\n		<p>The purpose of the workshop is to promote dialogue between basic and translational scientists and clinical research principal investigators. Researchers will present and discuss current and future fundamental, translational and clinical research and will plan the pipeline of research for treating Histone Mutated Midline Glioma. A consensus on the priority concepts for future research will be determined.</p>\r\n\r\n		<p>The workshop will also provide a forum for the NCI-CONNECT program''s advocacy partners to exchange information with researchers.</p>\r\n\r\n		<p><strong>When:</strong> Thursday, September 27, 2018<br />\r\n		<strong>Where:</strong> NIH Building 60<br />\r\n		1 Cloister Court<br />\r\n		Bethesda, Maryland 20892<br />\r\n		USA</p>\r\n\r\n		<p>Contact Us <a href="mailto:Kathleen.mercure@nih.gov" title="Kathleen.mercure@nih.gov">Kathleen.mercure@nih.gov</a></p>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p class="rtecenter"><a href="/nciconnect/registration" title="REGISTER LINK">REGISTER LINK</a></p>\r\n','','full_html');
INSERT INTO `field_data_body` VALUES ('node','page','0','7','7','und','0','<h2 class="rtecenter">Agenda</h2>\r\n\r\n<p><strong>September 27, 2018</strong></p>\r\n\r\n<p>8:30 a.m. - 4:00 p.m.</p>\r\n\r\n<p class="rteindent1">PIs, collaborators, and research staff to discuss current treatments, outcomes and concepts for future research for Histone Mutated Midline Glioma as part of the NCI-CONNECT scientific research program.</p>\r\n\r\n<p>4:30 p.m. - 7:00 p.m.</p>\r\n\r\n<p class="rteindent1">Following the workshop, there will be a group event for the participants.</p>\r\n\r\n<p>A more detailed agenda will be provided in the future.</p>\r\n\r\n<p class="rtecenter"><a href="/nciconnect/registration" title="REGISTER LINK">REGISTER LINK</a></p>\r\n','','full_html'),('node','page','0','8','8','und','0','<h2 class="rtecenter">Call for Proposals</h2>\r\n\r\n<p>During the workshop the researchers will present new concepts for clinical trials. To propose a study for NCI-CONNECT, please complete this <a href="/sites/default/files/Protocol%20Concept%20FORM.doc" title="Protocol Concept FORM">Protocol Concept FORM</a> and return it to Mark Gilbert, M.D., by August 10, 2018.</p>\r\n\r\n<p>Please direct all proposal related questions to Dr. Gilbert (240-760-6023, <a href="mailto:mark.gilbert@nih.gov" title="mark.gilbert@nih.gov">mark.gilbert@nih.gov</a>).</p>\r\n\r\n<p class="rtecenter"><a href="/nciconnect/registration" title="REGISTER LINK">REGISTER LINK</a></p>\r\n','','full_html'),('node','page','0','9','9','und','0','<h2 class="rtecenter">Travel</h2>\r\n\r\n<p><strong>Travel</strong></p>\r\n\r\n<ul>\r\n	<li>Meeting Participants:\r\n	<ul>\r\n		<li>The meeting will start early on Thursday, September 27. Participants may choose to arrive on the evening of Wednesday, September 26, 2018 to be certain they can access the shuttle from the hotel to NIH security Gateway.</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>Airports</strong></p>\r\n\r\n<ul>\r\n	<li>Dulles International Airport (IAD): Approximately 30-60 minutes away from the Marriott &amp; the NIH</li>\r\n	<li>Ronald Reagan Washington National Airport (DCA): Approximately 35-60 minutes away from the Marriott &amp; the NIH</li>\r\n	<li>Baltimore-Washington International Airport (BWI): Approximately 45 minutes to 2 hours away from the Marriott &amp; the NIH</li>\r\n</ul>\r\n\r\n<p class="rtecenter"><a href="/nciconnect/registration" title="REGISTER LINK">REGISTER LINK</a></p>\r\n','','full_html');
INSERT INTO `field_data_body` VALUES ('node','page','0','10','10','und','0','<h2 class="rtecenter">Lodging</h2>\r\n\r\n<p>Workshop participants are advised to reserve a hotel room at the <strong>Bethesda</strong> Marriott (information below) as the NIH will provide shuttle service from the Bethesda Marriott to the NIH meeting location to facilitate the visitor badging process and an on-time arrival. Workshop participants who make reservations at an alternate hotel can meet at the Bethesda Marriott to ride on the provided shuttle. Otherwise, participants are responsible for their own transportation to and from the meeting.</p>\r\n\r\n<p><strong>Bethesda Marriott</strong><br />\r\n5151 Pooks Hill Road<br />\r\nBethesda, MD 20814<br />\r\nT: 301-897-9400</p>\r\n\r\n<p><a href="https://www.marriott.com/hotels/travel/wasbt-bethesda-marriott/" target="_blank" title="Click here to make a hotel reservation at the Bethesda Marriott">Click here to make a hotel reservation at the Bethesda Marriott.</a>  Please note: There is not a hotel block or reserved rate for this workshop. We encourage you to book at your earliest convenience to secure a room.</p>\r\n\r\n<p class="rtecenter"><a href="/nciconnect/registration" title="REGISTER LINK">REGISTER LINK</a></p>\r\n','','full_html'),('node','page','0','11','11','und','0','<h2 class="rtecenter">NIH Campus Access</h2>\r\n\r\n<p><strong>NIH Gateway Center</strong></p>\r\n\r\n<p>All meeting participants must go through the NIH Gateway Center to access the NIH campus for the workshop. At the NIH Gateway Center, visitors (i.e., meeting participants) will be required to show one form of government-issued photo identification (i.e., driver''s license, passport, green card, etc.) and to state the purpose of their visit. (Shuttle service provided by the meeting from the hotel to NIH, will transport passengers to the security gate for screening, and will then proceed to the meeting location.)</p>\r\n\r\n<p><a href="https://www.ors.od.nih.gov/maps/Pages/Gateway-Center-Map.aspx" target="_blank" title="The NIH Gateway Center">The NIH Gateway Center</a> is located adjacent to the Medical Center Metro Station at the South Drive entrance to campus from Rockville Pike / Wisconsin Avenue (Route 355).</p>\r\n\r\n<p>The link below will provide all additional information you need to gain access to the NIH Campus.</p>\r\n\r\n<p><a href="https://www.nih.gov/about-nih/visitor-information/campus-access-security" target="_blank" title="https://www.nih.gov/about-nih/visitor-information/campus-access-security">https://www.nih.gov/about-nih/visitor-information/campus-access-security</a></p>\r\n\r\n<p>Participants staying at the Bethesda Marriott hotel will be provided <a href="/nciconnect/shuttles" title="Shuttle Service">Shuttle Service</a> to the workshop at NIH.</p>\r\n\r\n<p><strong>Visitor Entrance</strong></p>\r\n\r\n<p>In cases where participants do not use a meeting shuttle, they should be prepared to have their vehicles and their contents inspected upon entering the NIH campus. The participants will also be required to go through security at the Gateway Center and obtain a visitor ID badge, which may take up to 40 minutes. Participants will need to show a government-issued photo identification and should tell security their destination is Building 60 for the meeting. Please see the attachment for maps and additional directions. <a href="https://custom.cvent.com/4EA9FF1F93864F31820523AF1DA7B001/files/Event/4e1684d0d9eb413e986006a2d4d421ed/aa94ae8ef55f4bbcb85a8320e4b37c7c.pdf" target="_blank" title="NIH Visitor Access Map">NIH Visitor Access Map</a></p>\r\n\r\n<p class="rtecenter"><a href="/nciconnect/registration" title="REGISTER LINK">REGISTER LINK</a></p>\r\n','','full_html');
INSERT INTO `field_data_body` VALUES ('node','page','0','12','12','und','0','<h2 class="rtecenter">Shuttles</h2>\r\n\r\n<p><strong>Shuttles</strong></p>\r\n\r\n<p>Shuttle service will be provided from the Bethesda Marriott (<a href="https://book.passkey.com/event/49591597/owner/3322307/home" target="_blank" title="Lodging">see Lodging</a>) to the NIH to facilitate the visitor badging process and an on-time arrival.</p>\r\n\r\n<p><strong>Directions</strong></p>\r\n\r\n<p>All visitors attending this meeting must enter through the <a href="/nciconnect/nih-campus-access" title="NIH Gateway Center">NIH Gateway Center</a>.</p>\r\n\r\n<p><strong>Directions from outside of the NIH:</strong></p>\r\n\r\n<p>Map the NIH using the following address:</p>\r\n\r\n<p>NIH Gateway Center<br />\r\n9000 Rockville Pike<br />\r\nBethesda, MD 20892</p>\r\n\r\n<p><strong>Directions to the meeting location:</strong></p>\r\n\r\n<p>Once you have entered the NIH Gateway Center:</p>\r\n\r\n<p><a href="https://www.ors.od.nih.gov/maps/Documents/visitorAccessMap.pdf" target="_blank" title="NIH Building 60">NIH Building 60</a><br />\r\n1 Cloister Court<br />\r\nBethesda, MD 20892</p>\r\n\r\n<p class="rtecenter"><a href="/nciconnect/registration" title="REGISTER LINK">REGISTER LINK</a></p>\r\n','','full_html'),('node','page','0','13','13','und','0','<h2 class="rtecenter">Contact Us</h2>\r\n\r\n<p>For program related or all other questions, please contact:</p>\r\n\r\n<p class="rteindent1">Kathleen Mercure, MHSA [c]<br />\r\nProject Manager<br />\r\nNeuro-Oncology Branch<br />\r\nNational Cancer Institute<br />\r\nNational Institutes of Health<br />\r\nPhone: (240) 760-7641<br />\r\nEmail: <a href="mailto:Kathleen.Mercure@nih.gov" title="Kathleen.Mercure@nih.gov">Kathleen.Mercure@nih.gov</a></p>\r\n\r\n<p>For proposal related questions, please contact:</p>\r\n\r\n<p class="rteindent1">Mark Gilbert, M.D.<br />\r\nChief, Neuro-Oncology Branch<br />\r\nCenter for Cancer Research<br />\r\nNational Cancer Institute, NIH<br />\r\nPhone: 240-760-6023<br />\r\nEmail: <a href="mailto:Mark.Gilbert@nih.gov" title="Mark.Gilbert@nih.gov">Mark.Gilbert@nih.gov</a></p>\r\n\r\n<p class="rtecenter"><a href="/nciconnect/registration" title="REGISTER LINK">REGISTER LINK</a></p>\r\n','','full_html');
INSERT INTO `field_data_body` VALUES ('node','page','0','14','14','und','0','<h2 class="rtecenter">Directions</h2>\r\n\r\n<div>\r\n<div style="float:left;padding-right:50px;">Address of Event:<br />\r\n<strong><span style="font-size:16px">National Institutes of Health (NIH), Building 60<br />\r\n1 Cloister Court<br />\r\nBethesda, Maryland, 20892, USA</span></strong></div>\r\n\r\n<div style="float:left;padding-top:10px;">\r\n<p><iframe frameborder="0" height="450" src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d5939.790377197932!2d-77.11398069861069!3d39.00285971693125!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x89b7cbe411c35fad%3A0x5d3784baabd5a8ad!2s1+Cloister+Ct+Building+60%2C+Bethesda%2C+MD+20814!5e0!3m2!1sen!2sus!4v1529154949334" style="border:0" width="600"></iframe></p>\r\n</div>\r\n</div>\r\n','','full_html');
INSERT INTO `field_revision_body` VALUES ('node','page','0','1','1','und','0','<h2 class="rtecenter"><strong>2018 NCI Outstanding Mentor Award</strong></h2>\r\n\r\n<p class="rtecenter">Call for Nominations</p>\r\n\r\n\r\n<p>This year marks the 18th anniversary of the Outstanding Mentor Award, which recognizes NCI scientists for excellence in mentoring and guiding the careers of trainees in cancer research. All winners will be recognized at the annual NCI Award Ceremony this fall.</p>\r\n\r\n<p>Current NCI scientists who serve as mentors may be nominated with the exception of those who have received the award within the last five years. See complete list of previous winners on this website.</p>\r\n\r\n<p>Eligible categories include, but are not limited to, investigators, staff scientists, staff clinicians, contractor scientists, or any scientist in a role to mentor NCI fellows.&nbsp; Staff in all NCI Divisions (intramural and extramural) are eligible.&nbsp; If you are not certain whether or not someone is eligible, please contact Angela Jones at the Center for Cancer Training at&nbsp;<u><a href="https://mynci.cancer.gov/topics/ncimentorawards@mail.nih.gov">ncimentorawards@mail.nih.gov</a></u>.</p>\r\n\r\n<p>If you are a&nbsp;<strong>current postdoctoral fellow</strong>,&nbsp;<strong>research fellow</strong>, or&nbsp;<strong>clinical fellow,</strong> use this opportunity to nominate your outstanding mentor. The deadline for nominations is&nbsp;<strong>Friday,&nbsp;July 20, 2018.</strong></p>\r\n','','full_html'),('node','page','0','2','2','und','0','<h2 class="rtecenter"><strong>Instructions</strong></h2>\r\n\r\n<h3><strong>Eligibility</strong></h3>\r\n\r\n<p>Current NCI scientists who serve as mentors may be nominated,&nbsp;<strong>with the exception of those who have received the award within the last five years.&nbsp;&nbsp;</strong>Please review the list of previous winners to confirm eligibility before submitting your nomination. &nbsp;</p>\r\n\r\n<p>Eligible categories include investigators, staff scientists, staff clinicians, contractor scientists, or any NCI scientist in the role to mentor NCI fellows.&nbsp; Staff in all NCI Divisions (intramural and extramural) are eligible.&nbsp; If you are not certain if someone is eligible, please e-mail Angela Jones at &nbsp;<u><a href="mailto:ncimentorawards@mail.nih.gov">ncimentorawards@mail.nih.gov</a></u>.</p>\r\n\r\n<h3><strong>Review Criteria</strong></h3>\r\n\r\n<p>To evaluate each nomination, the review committee will consider seven separate criteria which address the quality of the nominee’s mentoring: mentoring record, professional expertise, accessibility, communication, training environment, provision of visibility for trainees, and commitment to trainee career development.&nbsp;</p>\r\n\r\n<h3><strong>Procedure</strong></h3>\r\n\r\n<ul>\r\n	<li>Download <a href="/sites/default/files/2018%20Outstanding%20Mentor%20Award%20Nomination%20Form.pdf" title="nomination form" alt="nomination form">nomination form</a> and <a href="/sites/default/files/2018%20Outstanding%20Mentor%20Award%20Signature%20Page.pdf" title="signature page" alt="signature page">optional signature page</a>.</li>\r\n	<li><strong>Each nominee must have ONE primary <em>and</em> ONE secondary nomination</strong>. The primary nominator is responsible for enlisting a secondary nominator.&nbsp; Incomplete nominations will not be reviewed and extra nominations will not be reviewed.&nbsp;</li>\r\n	<li>The <em>Primary</em> nominator must be a current postdoctoral fellow, research fellow, or clinical fellow (or recent fellow, i.e., departed NIH within the last 12 months).</li>\r\n	<li>The <strong>Secondary<strong> nominator may be a current or former fellow or student, or other trainee with appropriate knowledge of the nominee.</strong></strong></li>\r\n	<li><strong><strong><strong>Each</strong> nominator should write a narrative to address each of the criteria. One nomination form is required for each nomination. Please include both primary and secondary nominators’ narrative. </strong></strong></li>\r\n	<li><strong><strong>Optional: You may provide name, position, e-mail, and signature of any additional supporters by using the signature page. Submit the signature page (s) with the nomination package.</strong></strong></li>\r\n	<li><strong><strong>Save the document and upload as: <u>NomineeLastName.2018 OMA</u> (e.g., Jones.2018OMA) – where Jones refers to the mentor being nominated. PDF files required.</strong></strong></li>\r\n</ul>\r\n\r\n<p><strong><strong><strong>Completed nominations must be submitted&nbsp;no later than Friday, July 20, 2018.</strong></strong></strong></p>\r\n','','full_html');
INSERT INTO `field_revision_body` VALUES ('node','page','0','3','3','und','0','<h2 class="rtecenter">Previous Winners</h2>\r\n<!-- 1st Flex Container -->\r\n\r\n<div class="flex-container">\r\n<div>\r\n<div class="last-five-years">2017 Winners*</div>\r\n\r\n<ul>\r\n	<li>Eric A. Engels, M.D., M.P.H</li>\r\n	<li>Mark B. Lewandoski, Ph.D.</li>\r\n	<li>Beverly Mock, Ph.D.</li>\r\n</ul>\r\n</div>\r\n\r\n<div>\r\n<div class="last-five-years">2016 Winners*</div>\r\n\r\n<ul>\r\n	<li>Lalage M. Wakefield, D. Phil</li>\r\n	<li>Ying E. Zhang, Ph.D.</li>\r\n	<li>Zhi-Ming Zheng, M.D., Ph.D.</li>\r\n</ul>\r\n</div>\r\n\r\n<div>\r\n<div class="last-five-years">2015 Winners*</div>\r\n\r\n<ul>\r\n	<li>Aimee’ Kreimer, Ph.D.</li>\r\n	<li>Douglas Lowy, M.D.</li>\r\n	<li>Sholom Wacholder, Ph.D.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<!-- 2nd Flex Container -->\r\n\r\n<div class="flex-container">\r\n<div>\r\n<div class="last-five-years">2014 Winners*</div>\r\n\r\n<ul>\r\n	<li>Frank Gonzalez, Ph.D.</li>\r\n	<li>Sharon Savage, M.D.</li>\r\n	<li>Y. Robin Yabroff, Ph.D., MBA</li>\r\n</ul>\r\n</div>\r\n\r\n<div>\r\n<div class="last-five-years">2013 Winners*</div>\r\n\r\n<ul>\r\n	<li>Curtis Harris, M.D.</li>\r\n	<li>James Hodge, Ph.D., MBA</li>\r\n	<li>Esta Sterneck, Ph.D</li>\r\n</ul>\r\n</div>\r\n\r\n<div>\r\n<div>2012 Winners</div>\r\n\r\n<ul>\r\n	<li>Michael Gottesman, M.D.</li>\r\n	<li>Gordon Hager, Ph.D.</li>\r\n	<li>Mark Schifmann, M.D., M.P.H</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<!-- 3rd Flex Container -->\r\n\r\n<div class="flex-container">\r\n<div>\r\n<div>2011 Winners</div>\r\n\r\n<ul>\r\n	<li>Catherine Alfano, Ph.D.</li>\r\n	<li>Linda Nebling, Ph.D., M.P.H., R.D.</li>\r\n	<li>Snorri Thorgeirsson, M.D., Ph.D.</li>\r\n	<li>Margaret Tucker, M.D.</li>\r\n</ul>\r\n</div>\r\n\r\n<div>\r\n<div>2010 Winners</div>\r\n\r\n<ul>\r\n	<li>Kevin Camphausen, M.D.</li>\r\n	<li>Allan Hildesheim, Ph.D.</li>\r\n	<li>Katherine McGlynn, Ph.D., M.P.H.</li>\r\n</ul>\r\n</div>\r\n\r\n<div>\r\n<div>2009 Winner